import React from 'react';


const Home = () => {
    return (
        <div className="home">
            <div className="container">
                <div className="home-information">
                    <h2 className="home-title margin-bottom">AMRI</h2>
                    <h4 className="home-info">Creative Director</h4>
                    <p className="dome-desc">
                        I'am a developper
                    </p>
                </div>
            </div>
        </div>
    );
}




export default Home;
